import React from 'react';
import './header.css'
import imgas from '../images/Annotation 2024-01-23 201729.png';

function Headers(props) {
  if(ulHeader == 1300){
    ulHeader
  }
  return (
    <>
      <div className='header-contaier'>
        <p className='appName'>Photogram</p>
        <img className='HeaderImg' src={imgas} onClick={null}></img>
        <div className='ulHeader'>
          <ul>
            <li ><a href='/post'><span className='material-symbols-outlined' >add_photo_alternate</span>Post</a></li>
            <li ><a href='/all-posts'><span className='material-symbols-outlined'>post</span>All Posts</a></li>
            <li><a href='/login'><span className='material-symbols-outlined'>login</span> Lgoin</a></li>
          </ul>
        </div>
      </div>
    </>
  )
}

export default Headers
